import styled from 'styled-components'

const CalculateButton = styled.button`
  background-color: #004cff;
  border: none;
  color: white;
  padding: 15px 32px;
  text-align: center;
  text-decoration: none;
  font-size: 16px;
  cursor: pointer;
  border-radius: 5px;
  margin: 0 auto;
  display: block;
  
`;
export default CalculateButton;
